  false,\n\t\"url\": null,\n\t\"notes\": \"Location and extent of area:  Juab,  Millard,
  \ and  Iron  counties lie  in western  Utah,  and,  with the  exception  of  a  small
  \ part of  Iron County, are entirely within the Great Basin.  (See fig.  1.)  They
  comprise about 13,650 square miles, of which approximately 3,500 belong to Juab,
  6,775 to Millard, and 3,375 to Iron County.  Beaver County, which lies between Millard
  and Iron counties, is not discussed in this paper because its water resources have
  been described by W. T. Lee, of the United States Geological Survey, in Water-Supply
  Paper 217. Purpose of investigation: The investigation was begun in the summer of
  1908, under cooperative  agreement between the Director of the  United  States  Geological
  \ Survey  and  Caleb  Tanner,  State  engineer  of Utah,  the  object  of the  work
  \ being to  obtain  and  disseminate  information  which should  lead  to  a  greater
  \ utilization  of  the  groundwater supplies.\",\n\t\"license_title\": null,\n\t\"extras\":
